import datetime
import json
import os

# Dummy database
database = {
    "submissions": [],
    "fpds_data": [],
    "logs": [],
    "users": [],
}

# Functions to manage deletions by date
def delete_old_submissions(cutoff_date):
    global database
    database['submissions'] = [
        submission for submission in database['submissions'] 
        if submission['date'] >= cutoff_date
    ]

# Function to redesign resources page (using a simple print as a placeholder)
def redesign_resources_page(style):
    print(f"Resources page redesigned with {style} style.")

# Function to report user testing findings
def report_testing_findings(findings):
    with open('testing_findings.json', 'a') as f:
        json.dump(findings, f)
        f.write("\n")

# Function to log developer activities
def log_activity(activity):
    global database
    log_entry = {
        "timestamp": datetime.datetime.now().isoformat(),
        "activity": activity
    }
    database['logs'].append(log_entry)

# Function to validate FABS submissions
def validate_fabs_submission(submission):
    required_fields = ['field1', 'field2', 'field3']
    return all(field in submission for field in required_fields)

# Function to access published FABS submissions
def access_published_fabs():
    return [submission for submission in database['submissions'] if submission['published']]

# Function to generate D1 files based on FPDS data
def generate_d1_files():
    d1_files = []
    for data in database['fpds_data']:
        d1_file = f"D1_{data['id']}.txt"
        d1_files.append(d1_file)
        with open(d1_file, 'w') as f:
            f.write(json.dumps(data))
    return d1_files

# Function to load FPDS data
def load_fpds_data(data):
    global database
    database['fpds_data'].extend(data)

# Function to prevent double publishing
def prevent_double_publishing(submission_id):
    for submission in database['submissions']:
        if submission['id'] == submission_id and submission['published']:
            return False
    return True

# Function to derive office names from office codes
def derive_office_name(office_code):
    office_mapping = {
        '001': 'Office of Management',
        '002': 'Office of Operations',
    }
    return office_mapping.get(office_code, 'Unknown Office')

# Function to provide FABS groups based on FREC paradigm
def provide_fabs_groups():
    groups = {
        'Group1': ['Category1', 'Category2'],
        'Group2': ['Category3', 'Category4'],
    }
    return groups

# Function to download uploaded files related to submissions
def download_uploaded_file(file_id):
    file_path = f"uploads/{file_id}.pdf"
    if os.path.exists(file_path):
        return file_path
    return None

# Function to extract historical FPDS data
def extract_historical_fpds_data(start_date, end_date):
    return [
        data for data in database['fpds_data'] 
        if start_date <= data['date'] <= end_date
    ]

# Function to specify a user testing schedule
def specify_user_testing_schedule(schedule):
    with open('user_testing_schedule.json', 'w') as f:
        json.dump(schedule, f)

# Function to generate File F in the correct format for submissions
def generate_file_f(submission):
    file_f_content = f"File F Content for {submission['id']}\n"
    for field in submission:
        file_f_content += f"{field}: {submission[field]}\n"
    with open(f"File_F_{submission['id']}.txt", 'w') as f:
        f.write(file_f_content)

# Function to provide detailed information about specific submissions
def provide_submission_details(submission_id):
    for submission in database['submissions']:
        if submission['id'] == submission_id:
            return submission
    return None
